local displayedIcons = {}
local lastSearch = -1

-- returns an ordered list of fileIDs for icons; if search is nil or an empty string it returns all fileIDs; otherwise it returns only those that meet search criteria
function rematch.teamTabIcons:GetIcons(search)
    if search~=lastSearch then -- only repopulate the list if the search is different
        wipe(displayedIcons)
        for fileID,fileName in self:SearchIcons(search) do
            tinsert(displayedIcons,fileID)
        end
        lastSearch = search
    end
    return displayedIcons
end

-- iterator function to return the fileID and fileName all icons that meet the search text if one given; or all icons if no search text given
function rematch.teamTabIcons:SearchIcons(search)
	local i=0
    local mask
    if search and type(search)=="string" then
        search = search:trim()
        if search~="" then
            mask = rematch:DesensitizeText(search)
        end
    end
	return function()
        while i<#allIcons do
		    i=i+1
            if not mask or rematch:match(allIcons[i],mask) then
                local fileID,fileName = allIcons[i]:match("(%d+);(.+)")
                fileID = tonumber(fileID)
                return fileID,fileName
            end
		end
	end
end
